import React, {Component} from 'react';
import ChatBot from 'react-simple-chatbot';
const ChatSteps = [
        {
            id: '0',
            message: 'Hello Welcome. Enter the following information:',
            trigger: '1',
        },{
            id: '1',
            message: 'Please enter legal name:',
            trigger: '2'
          },{

            id: '2',
            user: true,
            trigger: '3',
          },
          {
            id: '3',
            message: "hi {previousValue}, how may I help you?",
            trigger: '4',
          },{

            id: '4',
            message: "what's up",
            end: true
          }

    ];
class PatientForm extends Component{
    render(){
        return(
             <ChatBot steps={ChatSteps} />
        )
    }
}

export default PatientForm;
